                cel.innerHTML = ObiektXMLHttp.responseText;
                $('.scroll-pane1').jScrollPane();
                $("table.conttabdt tr:even").css("background-color", "#f1f1f1"); 
            }
        }

        ObiektXMLHttp.send(null);    
        } 
} 

